bool ehPrimo(int n)
{
	int k = n;
	while (--k > 1)
		if (n % k == 0)
			return false;
	return true;
}

int maiorFatorPrimo(int n, vector<int> p)
{
	int i = p.size();
	while (--i >= 0)
		if (n % p.at(i) == 0)
			return p.at(i);
	return n;
}

vector<int> fatoresPrimos(int n, vector<int> p)
{
	vector<int> f;
	while (n > 1)
	{
		int m = maiorFatorPrimo(n, p);
		f.push_back(m);
		n /= m;
	}
	return f;
}

int segueJogada(int v[], int i)
{
	int m, k = 0;
	while (i > 0)
	{
		if (k++ % 3 == 0)
			m = i;
		i = v[i];
	}
	return m;
}

